import React from "react";
import NavbarItem from "../NavbarItem";
import { AuthConsumer } from "../../main/provedorAutenticacao";
import { Menu, Dropdown, Button } from "antd";

const NavBar = (props) => {
  const menu = (
    <Menu>
      <Menu.Item>
        <a href="#/barragens" label="Barragens">
          Barragens
        </a>
      </Menu.Item>
      <Menu.Item>
        <a href="#/ativos" label="Ativos">
          Ativos
        </a>
      </Menu.Item>
      <Menu.Item>
        <a href="#/listUsuarios" label="Usuários">
          Usuários
        </a>
      </Menu.Item>
      <Menu.Item>
        <a onClick={props.deslogar} href="#/login" label="Sair">
          Sair
        </a>
      </Menu.Item>
    </Menu>
  );
  return (
    <>
      <div className="navbar navbar-expand-sm fixed-top navbar-dark bg-primary">
        <div className="container" style={{ marginRight: "20px", height: '80px' }}>

          {props.isUsuarioAutenticado && (
            <Dropdown overlay={menu} placement="bottomLeft">
              <button
                className="navbar-toggler"
                type="button"
                data-toggle="collapse"
                data-target="#navbarResponsive"
                aria-controls="navbarResponsive"
                aria-expanded="false"
                aria-label="Toggle navigation"
              >
                <span className="navbar-toggler-icon"></span>
              </button>
            </Dropdown>
          )}
          <div className="collapse navbar-collapse" id="navbarResponsive">
            <ul className="navbar-nav">
              <NavbarItem
                render={props.isUsuarioAutenticado}
                href="#/barragens"
                label="Barragens"
              />
              <NavbarItem
                render={props.isUsuarioAutenticado}
                href="#/ativos"
                label="Ativos"
              />
              <NavbarItem
                render={props.isUsuarioAutenticado}
                href="#/listUsuarios"
                label="Usuários"
              />
              <NavbarItem
                render={props.isUsuarioAutenticado}
                href="#/monitoramento"
                label="Monitoramento"
              />
              <NavbarItem
                render={props.isUsuarioAutenticado}
                onClick={props.deslogar}
                href="#/login"
                label="Sair"
              />
            </ul>
          </div>
        </div>
      </div>
    </>
  );
};

export default () => (
  <AuthConsumer>
    {(context) => (
      <NavBar
        isUsuarioAutenticado={context.isAutenticado}
        deslogar={context.encerrarSessao}
      />
    )}
  </AuthConsumer>
);
